import './App.css';
import {Nav, Link} from 'react-router-dom';
import Routes from './route';


import Menu from './Menu/menu';



class App extends Component {
  render() {
    return (

      <div className="App">
        <header className="App-header">

                          <div className="barre">

                                <p>DASHBOARD</p>
                               <hr /> 
                              <Nav vertical>
                                <ol>
                                  <li><Link to="/">Menu</Link></li>
                                </ol>
                                <hr />  
                                <ol>
                                  <li><Link to="/contact">Contacts</Link></li>
                                </ol>
                                <hr />
                              </Nav>
<Routes/>
                           </div>

        </header>

      </div>
    );
  }
}

export default App;
